gado\nLED\nReinicio\nConexiones traseras\nCantidad de puertos tipo A USB 3.2 Gen 1 (3.1 Gen 1): 4\nCantidad de puertos tipo A USB 3.2 Gen 2 (3.1 Gen 2): 3\nN√∫mero de puertos USB 3.2 Gen 2x2 Tipo C: 1\nEthernet LAN (RJ-45) cantidad de puertos: 1\nN√∫mero de puertos HDMI: 1\nVersi√≥n HDMI: 2.1\nSalidas para auriculares: 1\nEntrada de l√≠nea: Si\nMicr√≥fono, jack de entrada: Si\nDimensiones: (L x An x Al) 460mm x 231mm x 490mm\nEquipo totalmente montado y testeado.\nGarant√≠a completa con recogida y entrega en domicilio.',5,4,1300.00);
